(715, 'DPS - Dispositivo de Proteção contra Surtos', 'Um componente elétrico que desvia picos de tensão (surtos) para o sistema de aterramento, protegendo equipamentos e instalações contra danos causados por descargas atmosféricas ou manobras na rede elétrica.', 1, 'disponivel', '2025-11-06 00:13:56', '2025-11-10 21:37:24'),
(716, 'Relé de segurança schemersal SRB 301MC-24V', 'Este relé monitora a condição de dispositivos de segurança, como botões de parada de emergência, chaves de segurança e cortinas de luz.', 2, 'disponivel', '2025-11-07 20:21:25', '2025-11-07 20:21:25'),
(717, 'Programador CPLD JTAG', 'É usado para programas dispositivos lógicos programáveis complexos(CPLDs) por meio da interface JTAG', 11, 'disponivel', '2025-11-07 20:34:16', '2025-11-07 20:34:36'),
(718, 'Relé  de Sobrecarga térmica TeSYs LRD da Schneider Eletric, modelo LRD21 ou LRD22', 'Ele é projetado para proteger motores elétricos contra Sobrecarga, aquecimento excessivo e falta de fase.', 5, 'disponivel', '2025-11-07 20:38:54', '2025-11-07 20:38:54'),
(719, 'Tomada industrial', 'Possuem a função de agir como ponto de conexão para o fornecimento de eletricidade a equipamentos.', 3, 'disponivel', '2025-11-07 20:43:48', '2025-11-07 20:43:48'),
(720, 'Disjuntor motor termomagnético Schneider Eletric GV2ME20', 'É projetado para proteção e controle de motores trifásicos.', 2, 'disponivel', '2025-11-07 20:46:06', '2025-11-07 20:46:16'),
(721, 'Botoeira de inspeção', 'São dispositivos de comando manual que ligam ou desligam um circuito elétrico', 1, 'disponivel', '2025-11-07 20:51:01', '2025-11-07 20:51:10'),
(722, 'Conversor de mídia Allied telesis AT- MC101XL Fast Ethernet', 'Converte sinais de 100Base-TX( Cabo de cobre RJ-45) para 100Base-FX', 8, 'disponivel', '2025-11-07 21:02:54', '2025-11-07 21:29:23'),
(723, 'Conversor de mídia Allied telesis AT-MC101XL fast ethernet', 'É um dispositivo autônomo e pode estender redes por até 2 km', 8, 'disponivel', '2025-11-07 21:06:17', '2025-11-07 21:06:17'),
(724, 'Módulo disjuntor bipolar', 'Dispositivo de segurança elétrica que protege dois polos( geralmente fase e fase) de um circuito contra Sobrecargas e curtos-circuitos.', 1, 'disponivel', '2025-11-07 21:11:03', '2025-11-07 21:11:03'),
(725, 'Módulo disjuntor trifásico', 'Geralmente está associado a disjuntores tripolar para quadros de distribuição ou a módulos de distribuição de energia com múltiplos disjuntores, ultilizados em instalações de iluminação e eventos.', 1, 'disponivel', '2025-11-07 21:15:36', '2025-11-07 21:15:36'),
(726, 'Dispositivo de proteção de surtos SIBRATEC, modelo SPD-20-275', 'O dps é um componente de segurança elétrica que protege equipamentos eletrônicos contra picos de tensão causados por descargas atmosféricas.', 0, 'disponivel', '2025-11-07 21:24:47', '2025-11-07 21:24:47'),
(727, 'Conector de Potência servo 90 10s', '', 1, 'disponivel', '2025-11-07 21:32:02', '2025-11-07 21:32:02'),
(728, 'Elemento bloco de contato 1na+1nf', 'Componente utiliza em comandos elétricos para automação industrial, Controle de elementos e movimentos em sistemas de segurança.', 3, 'disponivel', '2025-11-07 21:51:37', '2025-11-07 21:51:37'),
